INSERT INTO `changelog` (`id`, `module`, `desc`) VALUES
(1, 'Tags and View Module', 'Change Text to icons on Action Row in View and Tags Module for all User levels'),
(2, 'Tags Module', 'Change Order of list items from Ascending to Descending for all User Levels'),
(3, 'User Profile', 'Added user level on the users profile'),
(4, 'Admin Update Module', 'Added function to enable the Admin to edit the File Type (Open to all, Restricted, Confidential) of a record.'),
(5, 'Tagging Module', 'Add select all checkbox for all the checkboxes on the Tagging module.'),
(6, 'Edit Function', 'Set the edit function on admin panel to \"Read Only\" so that the date of the file cannot be changed unless allowed by the Super Admin'),
(7, 'Remove Tag', 'Include removing tags on tagging module.'),
(8, 'Download Module', 'Modify download bulk and include date range in downloading files in download module.'),
(9, 'Dashboard Module', 'Add Outgoing files in the percentage graph in Dashboard Module of admin.'),
(10, 'DMS', 'Apply icon to all buttons.'),
(11, 'DMS', 'User identification using \"Department\" (dynamically).'),
(12, 'Update Module', 'Auto select File type on Update modal. (required)'),
(13, 'My Profile Module', 'Add (display) user level on My Profile Module in all users. (Rank and File, Manager and Top Manager)'),
(14, 'Login Module', 'Include automatic change password upon first log in of user.'),
(15, 'Tag Module (Admin)', 'Include tracking of tagged file.'),
(16, 'Status Module', 'Include status (Pending, For Review, Ongoing, Signed and Completed)'),
(17, 'Tag Module', 'Add View tagged to Top Managers'),
(18, 'Tag Module', 'Restrict repeat tags.'),
(19, 'Upload Module', 'Add \"External\" in classification of uploaded files.'),
(20, 'Tag Module', 'Change color of unread tagged documents.'),
(21, 'History Module', 'Add subject name to history module.'),
(22, 'Upload Module', 'Add \"External\" and \"Internal\" options if file is Outgoing.'),
(23, 'View Module Admin', 'Make view list alphabetical.'),
(24, 'Tag Module', 'Include viewing and tagging to top managers.'),
(25, 'DMS', 'Include view of sequenced change in the whole DMS.');
